import React from "react";

const GastoListView = ({ gastos }) => {
  return (
    <table>
      <thead>
        <tr>
          <th className="tdConcepto w-24">Concepto</th>
          <th className="tdMonto">Monto</th>
          <th className="tdFecha">Fecha</th>
        </tr>
      </thead>
      <tbody>
        {gastos.map((gasto, index) => (
          <tr key={index} className="border-t">
            <td className="tdConcepto">{gasto.concepto}</td>
            <td className="tdMonto">${gasto.monto}</td>
            <td className="tdFecha">
              {(() => {
                const [year, month, day] = gasto.fechaRegistro.slice(0, 10).split("-");
                return `${day}-${month}-${year}`;
              })()}
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default GastoListView;
